import React, { Component } from 'react';
import {connect} from 'react-redux'
import { fetchItinerariesList} from '../store/actions/itinerariesActions'
// import { Link } from 'react-router-dom';



class Itineraries extends Component {

    constructor(props) {
        super(props);
        this.state = { 
            itineraries: [],
            fetchItineraryList: []
        }
    }

    componentDidMount(){
        this.props.fetchItinerariesList()
    }

    render() {

        return (
            <div className="flex-container">

            </div>
        )
    }
}

const mapStateToProps = state => {
    return {
        itineraries: state.initinearies,
        loading: state.itineraries.loading
    }
}

const mapDispatchToProps = dispatch => {
    return {
        fetchItinerariesList: ()=> dispatch(fetchItinerariesList())
    }
}


export default connect (
    mapStateToProps,
    mapDispatchToProps
)(Itineraries)
